caption.text:
Wahlkampf in Berlin bedeutet für mich auch Wahlkampf bei mir Zuhause in Tempelhof-Schöneberg. Hier unterstütze ich die sieben SPD-Kandidierenden für das Berliner Abgeordnetenhaus und das SPD-Team für den Bezirk. Mit allen habe ich schon an vielen Stellen zusammengearbeitet. Und ich weiß, wie wichtig eine starke SPD vor Ort auch für unsere bundespolitischen Vorhaben ist. 

Die SPD schaltet im Bund zur Schaffung bezahlbaren Wohnraums den Turbo an! Wir stellen bis 2026 für die soziale Wohnraumförderung 14,5 Milliarden Euro bereit - mehr als jemals zuvor in einer Regierungszeit. Außerdem stärken wir das Wohngeld: Seit 1. Januar ist es im Schnitt von 180 Euro pro Monat auf 370 Euro pro Monat gestiegen. Das ist doppelt so viel, wie bisher. Mit rund 2 Millionen Haushalten sind nun mehr als dreimal so viele Menschen anspruchsberechtigt. Ich selbst kämpfe im Bundestag zudem für eine deutliche Verschärfung des Mietrechts. Wir werden beispielsweise die Mietpreisbremse verlängern und die Möglichkeiten zur Mieterhöhung deutlich einschränken. Für die Menschen in meinem Wahlkreis wird das bedeuten, dass sie viel Geld sparen.

Für all das brauche ich starke sozialdemokratische Mitstreiter*innen im Abgeordnetenhaus und im Rathaus Schöneberg, die ebenfalls für bezahlbaren Wohnraum und sozialen Zusammenhalt kämpfen.

Daher meine Empfehlung für Tempelhof-Schöneberg und ganz Berlin: Morgen SPD wählen! 

